import React, { Component } from 'react';
import './index.scss';
import { Page, Content, FancyTitle } from '../';

class ErrorPage extends Component {
  render() {
    return (
      <Page className="error-page">
        <Content>
          <FancyTitle highlightedTitle="אופס, אירעה שגיאה." />

        </Content>
      </Page>
    );
  }
}

export default ErrorPage;
